import React from "react";

import logoImage from '../../assets/logo.png';

import { 
  Grid,
  ShopIcon,
  SearchBar,
  PromotionCard,
  PromotionIcon,
  PromotionMessage,
  CepCard,
  CepIcon,
  CepMessage,
  RowCard,
  SearchIcon,
  } from "./styles";

const Header: React.FC = () => {
  return (
    <Grid>

      {/* SI */}
      <ShopIcon>  
        <img alt="Logo" src={logoImage} />
      </ShopIcon>

      {/* SB */}
      <SearchBar>
        <Input type="text" placeholder="Conversar em #Chat-livre"/>
        <SearchIcon />
      </SearchBar>

      {/* PC */}
      <PromotionCard>
        <PromotionIcon />
        <PromotionMessage>As melhores ofertas até R$ 100</PromotionMessage>
      </PromotionCard>

      {/* CP */}
        <CepCard>
          <CepIcon/>
          <CepMessage>Infome seu CEP</CepMessage>
        </CepCard>

      {/* RC */}
      <RowCard>
          <a href="/">Categorias</a>
          <a href="/">Oferta do dia</a>
          <a href="/">Histórico</a>
          <a href="/">Supermecado</a>
          <a href="/">Moda</a>
          <a href="/">Vender</a>
          <a href="/">Contato</a>
      </RowCard> 

    </Grid>
  );
};

export default Header;
